import React from "react";
import { IoIosClose } from "react-icons/io";
import "./Item.css";

const Item = props => {
  return (
    <div>
      <div className="item">
        Item id: {props.id}
        <br />
        Item code: {props.code}
        <button className="delete-item" onClick={console.log("xd")}>
          <IoIosClose className="delete-icon" />
          <p>Delete item</p>
        </button>
      </div>
    </div>
  );
};

export default Item;
